import React from "react";
import "../Components/DisplayTodo.css";

function DisplayTodo(props) {
  return (
    <ul>
      {props.users.map((user) => (
        <li key={user.id}>
          {user.name} ({user.date} Deadline)
        </li>
      ))}
    </ul>
  );
}

export default DisplayTodo;
